import React from 'react';


function Home({ walletAddress }) {
  return (
    <div className="main-container home-container">
      <h2>Welcome, {walletAddress}!</h2>
      <p>You now have access to the Smart Wallet.</p>
      {/* Additional home page content */}
    </div>
  );
}

export default Home;
